import React from 'react'
import './ErrorPage.styles.css'

const ErrorPage = () =>{
    return(
        <div className="error-container">
            <h1 className="error-404">404</h1>
            <h2 className="error">This is ErrorPage</h2>
        </div>
    )
}

export default ErrorPage
